    const handleNumberProps = (pathId) => {
        let path = document.getElementById(pathId);
        if (path) {

            
            let textContent = pathId;

            let boundingBox = path.getBBox();

            let x = boundingBox.x + boundingBox.width / 2;
            let y = boundingBox.y + boundingBox.height / 2;
            let fontSize = (boundingBox.width < 100) ? "8px" : "16px";

            // If there is data, move the room number higher on the room path element.
            let anyData = false;

            if (measurements[pathId] && filter != "occupancy") {
                let value_type = `qe_${filter}`
                if (measurements[pathId][value_type] != "No data") {
                    anyData = true;
                }
            } else if (timetablesSis[pathId] && !isEmpty(timetablesSis[pathId])) {
                anyData = true;
            }

            if (anyData) y -= 25;


            if (specialParameters[pathId]) {
                x += specialParameters[pathId].x;
                y += specialParameters[pathId].y;
                if (specialParameters[pathId].fontSize) {
                    fontSize = specialParameters[pathId].fontSize;
                }
            }

            return {
                id: `${path}-number`,
                x: x,
                y: y,
                style: {
                    dominantBaseline: "middle",
                    textAnchor: "middle",
                    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
                    fontSize: fontSize,
                    fontWeight: "600",
                    userSelect: "none",
                    pointerEvents: "none",
                    zIndex: 3
                },
                
                children: textContent
            }
        } else {
            return;
        }
    };

